import React from 'react'   
import ImageCardList from './ImageCardList'

export default class Search extends React.Component {

  constructor() {
    super()
    this.state = {
      images: []
    }
  }

  componentDidMount() {
    fetch("https://nasa-file-search-backend.herokuapp.com/search?query=earth")
    .then(resp => resp.json())
      .then(json => {
        console.log(json.file)
        this.setState({
          images: json
        })
    })
  }


    render() {
        return (
          <div className="uk-container uk-margin">
            <div className="uk-container uk-flex uk-flex-between uk-margin">
              <div className="uk-inline uk-margin">
                <form className="uk-form-width-medium uk-search uk-search-default">
                  <input
                    className="uk-search-input"
                    type="search"
                    placeholder="Search..."
                  ></input>
                </form>
              </div>

              <div className="uk-inline">
                <button className="uk-button uk-button-default" type="button">
                  Filter
                </button>
                <div data-uk-dropdown="mode: click; pos: bottom-right">
                  This is a duck
                </div>
              </div>
            </div>
            <ImageCardList images={this.state.images}/>
          </div>
        );
    }
}
